INSERT INTO `encounters` (`encounterID`, `nm_name`, `nm_desc`, `nm_location`, `nm_level`, `nm_exp`, `nm_boxes`, `nm_crystals`, `bossName`, `aspect`, `simpleName`, `spawnWeather`, `mobWeather`, `respawnMinutes`) VALUES
(1, 'Unsafety Dance', 'Scattered flower petals adrift on the wind may calm the mind and soothe the soul, but being showered with needles detracts from the experience. Best halt Sabotender Corrido''s frenzied dance before someone loses an eye.', '(14.1x, 21.8y)', 1, 2490, 5, 3, 'Sabotender', 'wind', 'ea_sabotender', '', '', 120),
(2, 'The Shadow over Anemos', 'For all that we know of him, the Lord of Anemos may seek simply to protect his subjects. Alas, his ever-gaping maw reveals no secrets, only impossibly sharp teeth. However noble his intentions, he is a threat as great as any other when he approaches with undulating tentacles aloft.', '(27.8x, 28.2y)', 2, 3300, 6, 6, 'Lord', 'water', 'ea_seabishop', '', '', 120),
(3, 'Teles House', 'Thought to have abandoned the realm for more accommodating climes, imagine the surprise of the expeditionaries surveying Eureka when they found themselves halfway down the gullet of the legendary (killer) songbird, Teles.', '(26x, 26y)', 3, 4351, 7, 9, 'Teles', 'wind', 'ea_teles', '', '', 120),
(4, 'The Swarm Never Sets', 'More than twice the size of a Hyur male and at least as pestilent, the Emperor of Anemos has arrived to defend his empire against encroaching adventurers. The murderous look in his compound eyes will soon suppress any guilt you feel over this entirely avoidable situation.', '(17.2x, 23.9y)', 4, 5313, 8, 12, 'Emperor', 'wind', 'ea_emperoranemos', '', '', 120),
(5, 'One Missed Callisto', 'If a bear falls victim to mind-controlling spores in the woods, does it make a sound? Judging by the bestial roars echoing across the isle each night, the correct answer would be “yes.”', '(27.8x, 23.3y)', 5, 6588, 9, 15, 'Callisto', 'earth', 'ea_callisto', '', '', 120),
(6, 'By Numbers', 'A wicked puppetmaster''s abrupt disappearance from this plane has left his insentient servant free to wreak whatever havoc its mechanical mind can muster.', '(23.2x, 22.7y)', 6, 7225, 10, 18, 'Number', 'lightning', 'ea_number', '', '', 120),
(7, 'Disinherit the Wind', 'One might imagine wind spirits as gentle, if capricious, wanderers. The best cure for such delusions is to witness the wildly territorial Jahannam''s overblown reaction to the disruption of wind currents encircling its domain.', '(17.7x, 18.6y)', 7, 7984, 11, 21, 'Jahannam', 'wind', 'ea_jahannam', '', 'Gales', 120),
(9, 'Caym What May', 'Slaying a massive carnivorous scalekin may seem the end of one''s troubles, while in fact, it is just the beginning. That corpse left rotting in the forest is the perfect means for an aether-starved voidsent to worm its way into our realm...and start killing again.', '', 9, 9704, 13, 26, 'Caym', 'ice', 'ea_caym', '', '', 120),
(8, 'Prove Your Amemettle', 'Amemet knows that one doesn''t become an apex predator by being selective about his meals. He devours any creature that he can bite, tear, or bludgeon to death, including other carnivorous dinosaurs, and is now poised to eat Eureka out of island and ecosystem.', '', 8, 7984, 12, 24, 'Amemet', 'fire', 'ea_amemet', '', '', 120),
(10, 'The Killing of a Sacred Bombadier', 'Hyperbole can be employed to suggest that the stench of rotting goobbue seven days dead is enough to kill a man. If that rotting goobbue, however, is being used as a vessel for a voracious voidsent host, then the need for hyperbole is no more.', '(29x, 19y)', 10, 10772, 14, 28, 'Bombadeel', 'earth', 'ea_bombadeel', '', 'Night', 120),
(11, 'Short Serket 2', 'There is nothing worse than a marsh teeming with thousands of scuttling scorpions...except a marsh teeming with thousands of scuttling scorpions <i>and</i> their giant queen.', '(24x, 20y)', 11, 11304, 15, 30, 'Serket', 'earth', 'ea_serket', '', '', 120),
(12, 'Don''t Judge Me, Morbol', 'Upon discovering her seedbeds rendered barren by man''s savage sickles, Julika?ancient tangle of root and vine?has sworn vengeance on those who would dare slash her spawn. And her first step? To reseed the earth with a new army of loyal sprouts.', '', 12, 12661, 16, 32, 'Julika', 'ice', 'ea_julika', '', '', 120),
(14, 'When You Ride Alone', 'Don''t be fooled by his choice of attire. Come from the void to aid his hungry brethren in their quest to consume this realm''s aether, the White Rider is a deadly beacon for the forces of darkness.', '(20.2x ,13.3y)', 13, 14244, 17, 34, 'White Rider', 'lightning', 'ea_whiterider', '', 'Night', 120),
(15, 'Sing, Muse', 'Polyphemus is proof positive that fame and an enlarged cranium need not go together. Be that as it may, his large torso, large club, and large dinner parties (which only occasionally end with him devouring the guests, but are always terrible) are reason enough to extend him no hospitality.', '', 14, 15089, 18, 36, 'Polyphemus ', 'ice', 'ea_polyphemus', '', '', 120),
(16, 'Simurghasbord', 'After its avian prey was snatched right out of its beak, this ravening predator began a merciless hunt for anything—or anyone—it might carry away and devour. Proceed with caution, as surely a fowl foul enough to cannibalize other birds would have no qualms about downing a Lalafell or two.', '', 15, 17127, 19, 38, 'Simurgh', 'wind', 'ea_oldworldzu', '', '', 120),
(17, 'To the Mat', 'Once known to his loyal subjects as King of the Flame, for years Hazmat has wallowed in the lightless void, unable to wield his brilliant, fiery magicks. Now, unbound from the darkness, the self-proclaimed regent is free to set the world alight...literally.', '(34.8x, 19.9y)', 16, 18382, 20, 40, 'Hazmat', 'fire', 'ea_kinghazmat', '', '', 120),
(18, 'Wine and Honey', 'As the old saying goes: every wyrm''s ending is just a voidsent wyrm''s beginning. Banish this particularly vicious example, and remember that no one''s to blame—except the adventurers that killed the high dragon whose dying breath summoned forth this monstrosity.', '', 17, 22059, 21, 43, 'Fafnir', 'fire', 'ea_fafnir', '', 'Night', 120),
(19, 'I Amarok', 'When commanding an army of voidsent abominations on a campaign to quell a world of its light, two heads are always better than one. Luckily for Amarok?dread wolf of the deepvoid?he has three.', '(8.0x 18.0y)', 18, 26629, 22, 46, 'Amarok', 'ice', 'ea_amarok', '', '', 120),
(20, 'Drama Lamashtu', 'The hells have no fury like a woman scorned. They are, however, home to many a dead woman scorned, whose fury is possibly worse. The voidsent queen Lamashtu would know, since she''s the bloodsucking demon who killed them all.', '(24 7.7x 26.5y)', 19, 34412, 23, 48, 'Lamashtu', 'wind', 'ea_lamashtu', '', 'Night', 120),
(21, 'Wail in the Willows', 'The wind howls with voices of those long dead, heralding the advent of the high voidsent, Pazuzu. Weather the winds he wields, lest your own screaming soul be added to the chorus.', '', 20, 34412, 25, 50, 'Pazuzu', 'wind', 'ea_pazuzu', 'Gales', 'Night', 120);
